import React from 'react';
import './App.css';
import 'bootstrap/dist/css/bootstrap.css';
import { Button } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        Saudi Chat GPT
      </header>

      <div className="Container">

        <div className='boxContainer'>



          <div className='leftBox'>

            Saudi Chat GPT

          </div>

          <div className='rightBox'>

            <Button variant="success" className="rightBoxButton">
              Sign Up
            </Button>

            <Button variant="primary" className="rightBoxButton">
              Login
            </Button>


          </div>

        </div>

      </div>
    </div>
  );
}

export default App;
